import PopularRestaurant from "./popular-restaurants/PopularRestaurant";
import SignatureDish from "./signature-dishes/SignatureDish";
import "./HomePage.scss";
import claro from "../../assets/claro.png";
import lumina from "../../assets/mizlala-gret-mullet-fillet.png";
import tiger from "../../assets/screen-shot-2019-01-06-at-10-57-26.png";
import padKiMao from '../../../assets/rectangle_2.png';
import garbanzo from '../../assets/rectangle_3.png';
import pizza from '../../../assets/screen-shot-2019-01-06-at-10-57-26.png';
import vegiterian from '../../../assets/vegiterian-icon.png';
import spicy from '../../../assets/group-2.png';
import { Fragment } from "react";

const dummy = [
  {
    key: "m1",
    restaurantImage: claro,
    restaurantName: "Claro",
    chefName: "Ran Shmueli",
    chefDescription: "",
    chefImage: "",
    signatureName: "",
    signatureImage: padKiMao,
    signatureDescription: "",
    icon: vegiterian,
    price: 66,
  },
  {
    key: "m2",
    restaurantImage: lumina,
    restaurantName: "Lumina",
    chefName: "Meir Adoni",
    chefDescription: "",
    chefImage: "",
    signatureName: "",
    signatureImage: garbanzo,
    signatureDescription: "",
    icon: vegiterian,
    price: 25,
  },
  {
    key: "m3",
    restaurantImage: tiger,
    restaurantName: "Tiger Lilly",
    chefName: "Yanir Green",
    chefDescription: "",
    chefImage: "",
    signatureName: "",
    signatureImage: pizza,
    signatureDescription: "",
    icon: spicy,
    price: 45,
  },
];

const DummyData = () => {
  return (
    <Fragment>
      <div className="popular-container">
        <PopularRestaurant populars={dummy}></PopularRestaurant>
      </div>
      <div className="popular-container">
        <SignatureDish signatures={dummy}></SignatureDish>
      </div>
    </Fragment>
  );
};
// const DummyData= () => {
//     const popularList= DUMMY_DATA.map((restaurant) => (<PopularRestaurant key={restaurant.id} restaurantName={restaurant.restaurantName} chefName={restaurant.chefName} restaurantImage={restaurant.restaurantImage} />));
//   //  const signatureList= DUMMY_DATA.map((dish) => (<SignatureDish key={dish.id} signatureName={dish.signatureName} signatureImage={dish.signatureImage} signatureDescription={dish.signatureDescription} icon={dish.icon} price={dish.price} />));
//     const chefList= DUMMY_DATA.map((chef) => (<Chef key={chef.id} chefName={chef.chefName} chefImage={chef.chefImage} chefDescription={chef.chefDescription}/>));

export default DummyData;
